  }
  const goToMain = () => {
    navigate("/");
  }

  return (
    <a.LoginBox>
      <a.Logo src={require('../../images/LogoBlack.png')} onClick={goToMain}/>
      <a.InputWrap>
        <a.InputBox placeholder='이메일'/>
      </a.InputWrap>
