      </a.InputWrap>
      <a.LoginError>인증번호가 일치하지않습니다.</a.LoginError>
      <a.SignInBtn onClick={goToMain}>비밀번호 변경</a.SignInBtn>
      <a.FindWrap>
        <a.FindBox>비밀번호찾기</a.FindBox>
        <a.Contour/>
        <a.FindBox>아이디찾기</a.FindBox>
      </a.FindWrap>
      <a.LoginBtn onClick={goToMain}>취소</a.LoginBtn>
    </a.LoginBox>
  );
}

export default ChangePwCheck;
